// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract DAOCOPY is Ownable {
  using SafeMath for uint;

  // Variables  
  address payable treasury;
  mapping (address => mapping(address => uint256)) public userInvestment;
  mapping (address => uint256) public totalInvestment;
  mapping (address => bool) public tokenIsListed;
  mapping (address => bool) public tokenIsClaimable;
  mapping (address => uint) public amountToDistribute;
  mapping (address => uint) public investmentToExecute;  

  constructor(address payable _treasury) {
    treasury = _treasury;
  } 

  /**
   * @dev invest in one of the listed tokens in the DAO
   * @param token: address of the token to invest
   */
  function invest(address token) payable public {
    require(token != address(0), "cannot invest in null address");
    require(tokenIsListed[token] == true, "token must be listed");
    require(tokenIsClaimable[token] == false, "token must be yet unclaimable");
    require(msg.value > 0, "cannot invest 0 amount");
    userInvestment[msg.sender][token] += msg.value;
    totalInvestment[token] += msg.value;
    investmentToExecute[token] += msg.value;
  }

  /**
   * @dev users claim their tokens where they invested
   * @param token: address of the token to be claimed
   */
  function claimTokens(address token) public {
    require(token != address(0), "cannot claim null address");
    require(tokenIsClaimable[token] == true, "token must be claimable");
    require(userInvestment[msg.sender][token] > 0, "user must have funds to claim");    
    uint fundsToDistribute = amountToDistribute[token];
    uint amount = fundsToDistribute.mul(userInvestment[msg.sender][token]).div(totalInvestment[token]);
    userInvestment[msg.sender][token] = 0;
    IERC20 tokenInstance = IERC20(token);
    tokenInstance.transfer(msg.sender, amount);
  }

  /**
   * @dev admin will execute this function once the DAO receive the tokens
   * @param token: address of the token received by the DAO
   */
  function listToken(address token) public onlyOwner {
    require(token != address(0), "cannot list null address");
    require(tokenIsListed[token] == false, "the token must be unlisted");
    tokenIsListed[token] = true;
  }

  /**
   * @dev admin to send all the funds for specific project to the project address
   * @param token: address of the token to execute investment
   * @param to: address of the project admin which will receive DAO's funds
   */
  function executeInvestment(address token, address to) public payable onlyOwner {
    require(to != address(0), "cannot invest in null address");
    require(investmentToExecute[token] > 0, "cannot execute investment with 0 amount");
    uint amount = investmentToExecute[token];
    investmentToExecute[token] = 0;
    tokenIsListed[token] = false;
    payable(to).transfer(amount);
  }

  /**
   * @dev admin will execute this function once the DAO receive the tokens
   * @param token: address of the token received by the DAO
   */
  function makeTokenClaimable(address token) public onlyOwner {
    require(tokenIsClaimable[token] == false, "the token must be unclaimable");
    require(tokenIsListed[token] == false, "the token must be unlisted");
    IERC20 tokenInstance = IERC20(token);
    // 5% of the tokens go to the treasury
    uint treasuryAmount = tokenInstance.balanceOf(address(this)).mul(5).div(100);
    tokenInstance.transfer(treasury, treasuryAmount);
    uint funds = tokenInstance.balanceOf(address(this));
    amountToDistribute[token] = funds;
    tokenIsClaimable[token] = true;
  }
}

